import React from "react";
import picture1 from "../assets/picture1.jpg";

const BlockNewProduct: React.FC = () => {
  return (
    <div>
      <div className="max-w-52 max-h-fit">
        <img src={picture1} alt="picture1"></img>
      </div>
    </div>
  );
};

export default BlockNewProduct;
